Given the following program, identify all intermediate or unused variables (it can be a global variable, local variable, function parameter, etc.). Please write the identified variable names into a json: {'target_list': [a list of variable names]}. If no variable is identified, just give an empty list.. The program is fn main() {
    let h: u32 = 5;
    let arg: u32 = 4;
    let i: u32 = 2;
    let j: u32 = 0;
    let mut k: u32;
    k = arg;
    let mut l: u32;
    l = 0;
    l |= 1 << j;
    l = ((i as u64 * l as u64) % h as u64) as u32;
    k = ((k as u64 * l as u64) % h as u64) as u32;

    assert_eq!(k, 3);
